g\/wiki\/%D0%9B%D0%BE%D0%BD%D0%B4%D0%BE%D0%BD\" title=\"\u041b\u043e\u043d\u0434\u043e\u043d\">\u041b\u043e\u043d\u0434\u043e\u043d\u0435<\/a> \u0420\u0438\u0447\u0430\u0440\u0434 \u041c\u0430\u0440\u0442\u0438\u043d \u0437\u0430\u0441\u0442\u0440\u0430\u0445\u043e\u0432\u0430\u043b \u0436\u0438\u0437\u043d\u044c \u0423\u0438\u043b\u044c\u044f\u043c\u0430 \u0413\u0438\u0431\u0431\u0441\u043e\u043d\u0430 \u043d\u0430 \u0441\u0443\u043c\u043c\u0443 383 \u0444\u0443\u043d\u0442\u0430.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1757_%D0%B3%D0%BE%D0%B4\" title=\"1757 \u0433\u043e\u0434\">1757<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%BE%D0%BB%D0%B8%D0%BD%D1%81%D0%BA%D0%BE%D0%B5_%D1%81%D1%80%D0%B0%D0%B6%D0%B5%D0%BD%D0%B8%D0%B5\" title=\"\u041a\u043e\u043b\u0438\u043d\u0441\u043a\u043e\u0435 \u0441\u0440\u0430\u0436\u0435\u043d\u0438\u0435\">\u0431\u0438\u0442\u0432\u0430 \u043f\u0440\u0438 \u041a\u043e\u043b\u0438\u043d\u0435<\/a>. \u0421\u0440\u0430\u0436\u0435\u043d\u0438\u0435 \u0437\u0430\u043c\u0435\u0447\u0430\u0442\u0435\u043b\u044c\u043d\u043e \u0442\u0435\u043c, \u0447\u0442\u043e \u0432 \u043d\u0451\u043c \u0431\u044b\u043b\u043e \u043d\u0430\u043d\u0435\u0441\u0435\u043d\u043e \u043f\u0435\u0440\u0432\u043e\u0435 \u043f\u043e\u0440\u0430\u0436\u0435\u043d\u0438\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A4%D1%80%D0%B8%D0%B4%D1%80%D0%B8%D1%85_II_(%D0%BA%D0%BE%D1%80%D0%BE%D0%BB%D1%8C_%D0%9F%D1%80%D1%83%D1%81%D1%81%D0%B8%D0%B8)\" title=\"\u0424\u0440\u0438\u0434\u0440\u0438\u0445 II (\u043a\u043e\u0440\u043e\u043b\u044c \u041f\u0440\u0443\u0441\u0441\u0438\u0438)\">\u0424\u0440\u0438\u0434\u0440\u0438\u0445\u0443 II<\/a>, \u043f\u0440\u043e\u0441\u043b\u0430\u0432\u043b\u0435\u043d\u043d\u043e\u043c\u0443 \u043f\u043e\u043b\u043a\u043e\u0432\u043e\u0434\u0446\u0443 \u0441\u0432\u043e\u0435\u0433\u043e \u0432\u0440\u0435\u043c\u0435\u043d\u0438, \u0432 \u0421\u0435\u043c\u0438\u043b\u0435\u0442\u043d\u0435\u0439 \u0432\u043e\u0439\u043d\u0435.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1761_%D0%B3%D0%BE%D0%B4\" title=\"1761 \u0433\u043e\u0434\">1761<\/a>&#160;\u2014 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%BE%D1%81%D1%81%D0%B8%D0%B9%D1%81%D0%BA%D0%B0%D1%8F_%D0%B8%D0%BC%D0%BF%D0%B5%D1%80%D0%B8%D1%8F\" title=\"\u0420\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u0430\u044f \u0438\u043c\u043f\u0435\u0440\u0438\u044f\">\u0420\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u043e\u0439 \u0438\u043c\u043f\u0435\u0440\u0438\u0438<\/a> \u0443\u0447\u0440\u0435\u0436\u0434\u0430\u044e\u0442\u0441\u044f \u043f\u0435\u043d\u0441\u0438\u0438 \u0437\u0430 \u0441\u043b\u0443\u0436\u0431\u0443.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1799_%D0%B3%D0%BE%D0%B4\" title=\"1799 \u0433\u043e\u0434\">1799<\/a>&#160;\u2014 \u0440\u0443\u0441\u0441\u043a\u0430\u044f \u0430\u0440\u043c\u0438\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D1%83%D0%B2%D0%BE%D1%80%D0%BE%D0%B2,_%D0%90%D0%BB%D0%B5%D0%BA%D1%81%D0%B0%D0%BD%D0%B4%D1%80_%D0%92%D0%B0%D1%81%D0%B8%D0%BB%D1%8C%D0%B5%D0%B2%D0%B8%D1%87\" title=\"\u0421\u0443\u0432\u043e\u0440\u043e\u0432, \u0410\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440 \u0412\u0430\u0441\u0438\u043b\u044c\u0435\u0432\u0438\u0447\">\u0410\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440\u0430 \u0421\u0443\u0432\u043e\u0440\u043e\u0432\u0430<\/a>, \u0441\u043e\u0432\u0435\u0440\u0448\u0430\u044f \u043d\u0435\u043e\u0436\u0438\u0434\u0430\u043d\u043d\u044b\u0439 \u043f\u0435\u0440\u0435\u0445\u043e\u0434 \u0447\u0435\u0440\u0435\u0437 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BB%D1%8C%D0%BF%D1%8B\" title=\"\u0410\u043b\u044c\u043f\u044b\">\u0410\u043b\u044c\u043f\u044b<\/a>, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B8%D1%82%D0%B2%D0%B0_%D0%BF%D1%80%D0%B8_%D0%A2%D1%80%D0%B5%D0%B1%D0%B1%D0%B8%D0%B8_(1799)\" title=\"\u0411\u0438\u0442\u0432\u0430 \u043f\u0440\u0438 \u0422\u0440\u0435\u0431\u0431\u0438\u0438 (1799)\">\u0440\u0430\u0437\u0431\u0438\u0432\u0430\u0435\u0442 \u0444\u0440\u0430\u043d\u0446\u0443\u0437\u0441\u043a\u0443\u044e \u0430\u0440\u043c\u0438\u044e<\/a> \u043d\u0430 \u0440\u0435\u043a\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D1%80%D0%B5%D0%B1%D0%B1%D0%B8%D1%8F\" title=\"\u0422\u0440\u0435\u0431\u0431\u0438\u044f\">\u0422\u0440\u0435\u0431\u0431\u0438\u044f<\/a> (\u0421\u0435\u0432\u0435\u0440\u043d\u0430\u044f \u0418\u0442\u0430\u043b\u0438\u044f).<\/li><\/ul><h3>XIX \u0432\u0435\u043a <\/h3><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1807_%D0%B3%D0%BE%D0%B4\" title=\"1807 \u0433\u043e\u0434\">1807<\/a>&#160;\u2014 \u0441\u043e\u0441\u0442\u043e\u044f\u043b\u043e\u0441\u044c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D1%80%D0%BF%D0%B0%D1%87%D0%B0%D0%B9%D1%81%D0%BA%D0%BE%D0%B5_%D1%81%D1%80%D0%B0%D0%B6%D0%B5%D0%BD%D0%B8%D0%B5\" title=\"\u0410\u0440\u043f\u0430\u0447\u0430\u0439\u0441\u043a\u043e\u0435 \u0441\u0440\u0430\u0436\u0435\u043d\u0438\u0435\">\u0410\u0440\u043f\u0430\u0447\u0430\u0439\u0441\u043a\u043e\u0435 \u0441\u0440\u0430\u0436\u0435\u043d\u0438\u0435<\/a> \u043c\u0435\u0436\u0434\u0443 \u0432\u043e\u0439\u0441\u043a\u043e\u043c \u0442\u0443\u0440\u0435\u0446\u043a\u043e\u0433\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B8%D0%B7%D0%B8%D1%80%D1%8C\" title=\"\u0412\u0438\u0437\u0438\u0440\u044c\">\u0432\u0438\u0437\u0438\u0440\u044f<\/a> <a href=\"https:\/\/ru.wikipedia.org\/w\/index.php?title=%D0%AE%D1%81%D1%83%D1%84-%D0%BF%D0%B0%D1%88%D0%B0&amp;action=edit&amp;redlink=1\" class=\"new\" title=\"\u042e\u0441\u0443\u0444-\u043f\u0430\u0448\u0430 (\u0441\u0442\u0440\u0430\u043d\u0438\u0446\u0430 \u043e\u0442\u0441\u0443\u0442\u0441\u0442\u0432\u0443\u0435\u0442)\">\u042e\u0441\u0443\u0444\u0430-\u043f\u0430\u0448\u0438<\/a> \u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D1%83%D1%81%D1%81%D0%BA%D0%B0%D1%8F_%D0%B8%D0%BC%D0%BF%D0%B5%D1%80%D0%B0%D1%82%D0%BE%D1%80%D1%81%D0%BA%D0%B0%D1%8F_%D0%B0%D1%80%D0%BC%D0%B8%D1%8F\" title=\"\u0420\u0443\u0441\u0441\u043a\u0430\u044f \u0438\u043c\u043f\u0435\u0440\u0430\u0442\u043e\u0440\u0441\u043a\u0430\u044f \u0430\u0440\u043c\u0438\u044f\">\u0420\u0443\u0441\u0441\u043a\u043e\u0439 \u0438\u043c\u043f\u0435\u0440\u0430\u0442\u043e\u0440\u0441\u043a\u043e\u0439 \u0430\u0440\u043c\u0438\u0435\u0439<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1812_%D0%B3%D0%BE%D0%B4\" title=\"1812 \u0433\u043e\u0434\">1812<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%A8%D0%90\" class=\"mw-redirect\" title=\"\u0421\u0428\u0410\">\u0421\u0428\u0410<\/a> \u043e\u0431\u044a\u044f\u0432\u0438\u043b\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BD%D0%B3%D0%BB%D0%BE-%D0%B0%D0%BC%D0%B5%D1%80%D0%B8%D0%BA%D0%B0%D0%BD%D1%81%D0%BA%D0%B0%D1%8F_%D0%B2%D0%BE%D0%B9%D0%BD%D0%B0\" title=\"\u0410\u043d\u0433\u043b\u043e-\u0430\u043c\u0435\u0440\u0438\u043a\u0430\u043d\u0441\u043a\u0430\u044f \u0432\u043e\u0439\u043d\u0430\">\u0432\u043e\u0439\u043d\u0443<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B5%D0%BB%D0%B8%D0%BA%D0%BE%D0%B1%D1%80%D0%B8%D1%82%D0%B0%D0%BD%D0%B8%D1%8F\" title=\"\u0412\u0435\u043b\u0438\u043a\u043e\u0431\u0440\u0438\u0442\u0430\u043d\u0438\u044f\">\u0412\u0435\u043b\u0438\u043a\u043e\u0431\u0440\u0438\u0442\u0430\u043d\u0438\u0438<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1815_%D0%B3%D0%BE%D0%B4\" title=\"1815 \u0433\u043e\u0434\">1815<\/a>&#160;\u2014 \u043f\u043e\u0440\u0430\u0436\u0435\u043d\u0438\u0435 \u0430\u0440\u043c\u0438\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%B0%D0%BF%D0%BE%D0%BB%D0%B5%D0%BE%D0%BD_I_%D0%91%D0%BE%D0%BD%D0%B0%D0%BF%D0%B0%D1%80%D1%82\" class=\"mw-redirect\" title=\"\u041d\u0430\u043f\u043e\u043b\u0435\u043e\u043d I \u0411\u043e\u043d\u0430\u043f\u0430\u0440\u0442\">\u041d\u0430\u043f\u043e\u043b\u0435\u043e\u043d\u0430 I<\/a> \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B8%D1%82%D0%B2%D0%B0_%D0%BF%D1%80%D0%B8_%D0%92%D0%B0%D1%82%D0%B5%D1%80%D0%BB%D0%BE%D0%BE\" title=\"\u0411\u0438\u0442\u0432\u0430 \u043f\u0440\u0438 \u0412\u0430\u0442\u0435\u0440\u043b\u043e\u043e\">\u0431\u0438\u0442\u0432\u0435 \u043f\u0440\u0438 \u0412\u0430\u0442\u0435\u0440\u043b\u043e\u043e<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1817_%D0%B3%D0%BE%D0%B4\" title=\"1817 \u0433\u043e\u0434\">1817<\/a>&#160;\u2014 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%BE%D0%BD%D0%B4%D0%BE%D0%BD\" title=\"\u041b\u043e\u043d\u0434\u043e\u043d\">\u041b\u043e\u043d\u0434\u043e\u043d\u0435<\/a> \u043e\u0442\u043a\u0440\u044b\u0442 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%BE%D1%81%D1%82_%D0%92%D0%B0%D1%82%D0%B5%D1%80%D0%BB%D0%BE%D0%BE\" title=\"\u041c\u043e\u0441\u0442 \u0412\u0430\u0442\u0435\u0440\u043b\u043e\u043e\">\u043c\u043e\u0441\u0442 \u0412\u0430\u0442\u0435\u0440\u043b\u043e\u043e<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1837_%D0%B3%D0%BE%D0%B4\" title=\"1837 \u0433\u043e\u0434\">1837<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D1%81%D0%BF%D0%B0%D0%BD%D0%B8%D1%8F\" title=\"\u0418\u0441\u043f\u0430\u043d\u0438\u044f\">\u0418\u0441\u043f\u0430\u043d\u0438\u044f<\/a> \u043f\u0440\u0438\u043d\u044f\u043b\u0430 \u043d\u043e\u0432\u0443\u044e \u041a\u043e\u043d\u0441\u0442\u0438\u0442\u0443\u0446\u0438\u044e.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1840_%D0%B3%D0%BE%D0%B4\" title=\"1840 \u0433\u043e\u0434\">1840<\/a>&#160;\u2014 25-\u043b\u0435\u0442\u043d\u044f\u044f \u0436\u0435\u043d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B5%D1%80%D0%B4%D0%B8,_%D0%94%D0%B6%D1%83%D0%B7%D0%B5%D0%BF%D0%BF%D0%B5\" title=\"\u0412\u0435\u0440\u0434\u0438, \u0414\u0436\u0443\u0437\u0435\u043f\u043f\u0435\">\u0414\u0436\u0443\u0437\u0435\u043f\u043f\u0435 \u0412\u0435\u0440\u0434\u0438<\/a> \u041c\u0430\u0440\u0433\u0435\u0440\u0438\u0442\u0430 \u0411\u0430\u0440\u0435\u0446\u0446\u0438 (Margherita Barezzi) \u0443\u043c\u0435\u0440\u043b\u0430 \u043e\u0442 \u044d\u043d\u0446\u0435\u0444\u0430\u043b\u0438\u0442\u0430. \u0412\u0435\u043b\u0438\u0447\u0430\u0439\u0448\u0430\u044f \u0442\u0440\u0430\u0433\u0435\u0434\u0438\u044f \u0432 \u0436\u0438\u0437\u043d\u0438 \u0437\u043d\u0430\u043c\u0435\u043d\u0438\u0442\u043e\u0433\u043e \u0432\u043f\u043e\u0441\u043b\u0435\u0434\u0441\u0442\u0432\u0438\u0438 \u043a\u043e\u043c\u043f\u043e\u0437\u0438\u0442\u043e\u0440\u0430 \u0431\u044b\u043b\u0430 \u0443\u0441\u0443\u0433\u0443\u0431\u043b\u0435\u043d\u0430 \u0441\u043c\u0435\u0440\u0442\u044c\u044e \u0438\u0445 \u0434\u0432\u043e\u0438\u0445 \u0434\u0435\u0442\u0435\u0439 \u0432 \u043f\u0440\u0435\u0434\u044b\u0434\u0443\u0449\u0438\u0435 \u043f\u043e\u043b\u0442\u043e\u0440\u0430 \u0433\u043e\u0434\u0430.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1852_%D0%B3%D0%BE%D0%B4\" title=\"1852 \u0433\u043e\u0434\">1852<\/a>&#160;\u2014 \u0432\u044b\u0448\u0435\u043b \u0443\u043a\u0430\u0437 \u0438\u043c\u043f\u0435\u0440\u0430\u0442\u043e\u0440\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%B8%D0%BA%D0%BE%D0%BB%D0%B0%D0%B9_I\" title=\"\u041d\u0438\u043a\u043e\u043b\u0430\u0439 I\">\u041d\u0438\u043a\u043e\u043b\u0430\u044f I<\/a> \u043e \u0441\u043e\u0437\u0434\u0430\u043d\u0438\u0438 \u043e\u0442\u0434\u0435\u043b\u0435\u043d\u0438\u044f \u0434\u043b\u044f \u0443\u043c\u0430\u043b\u0438\u0448\u0451\u043d\u043d\u044b\u0445 \u0430\u0440\u0435\u0441\u0442\u0430\u043d\u0442\u043e\u0432 \u043f\u0440\u0438 \u0438\u0441\u043f\u0440\u0430\u0432\u0438\u0442\u0435\u043b\u044c\u043d\u043e\u043c \u0434\u043e\u043c\u0435.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1873_%D0%B3%D0%BE%D0%B4\" title=\"1873 \u0433\u043e\u0434\">1873<\/a>&#160;\u2014 \u0430\u043c\u0435\u0440\u0438\u043a\u0430\u043d\u0441\u043a\u0430\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D1%83%D1%84%D1%80%D0%B0%D0%B6%D0%B8%D1%81%D1%82%D0%BA%D0%B8\" title=\"\u0421\u0443\u0444\u0440\u0430\u0436\u0438\u0441\u0442\u043a\u0438\">\u0441\u0443\u0444\u0440\u0430\u0436\u0438\u0441\u0442\u043a\u0430<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%AD%D0%BD%D1%82%D0%BE%D0%BD%D0%B8,_%D0%A1%D1%8C%D1%8E%D0%B7%D0%B5%D0%BD\" title=\"\u042d\u043d\u0442\u043e\u043d\u0438, \u0421\u044c\u044e\u0437\u0435\u043d\">\u0421\u044c\u044e\u0437\u0435\u043d \u042d\u043d\u0442\u043e\u043d\u0438<\/a> \u0431\u044b\u043b\u0430 \u043e\u0448\u0442\u0440\u0430\u0444\u043e\u0432\u0430\u043d\u0430 \u043d\u0430 100 \u0434\u043e\u043b\u043b\u0430\u0440\u043e\u0432 \u0437\u0430 \u043f\u043e\u043f\u044b\u0442\u043a\u0443 \u043f\u0440\u043e\u0433\u043e\u043b\u043e\u0441\u043e\u0432\u0430\u0442\u044c \u043d\u0430 \u043f\u0440\u0435\u0437\u0438\u0434\u0435\u043d\u0442\u0441\u043a\u0438\u0445 \u0432\u044b\u0431\u043e\u0440\u0430\u0445 \u0432 \u0421\u0428\u0410 \u0432 1872 \u0433\u043e\u0434\u0443. \u041a\u0430\u043a \u0438\u0441\u0442\u0438\u043d\u043d\u044b\u0439 \u0431\u043e\u0440\u0435\u0446, \u0448\u0442\u0440\u0430\u0444\u0430 \u043e\u043d\u0430 \u0442\u0430\u043a \u0438 \u043d\u0435 \u0437\u0430\u043f\u043b\u0430\u0442\u0438\u043b\u0430.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1881_%D0%B3%D0%BE%D0%B4\" title=\"1881 \u0433\u043e\u0434\">1881<\/a>&#160;\u2014 \u0432\u043e\u0437\u043e\u0431\u043d\u043e\u0432\u043b\u0435\u043d\u0438\u0435 \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%BE%D1%8E%D0%B7_%D1%82%D1%80%D1%91%D1%85_%D0%B8%D0%BC%D0%BF%D0%B5%D1%80%D0%B0%D1%82%D0%BE%D1%80%D0%BE%D0%B2\" title=\"\u0421\u043e\u044e\u0437 \u0442\u0440\u0451\u0445 \u0438\u043c\u043f\u0435\u0440\u0430\u0442\u043e\u0440\u043e\u0432\">\u0421\u043e\u044e\u0437\u0430 \u0442\u0440\u0451\u0445 \u0438\u043c\u043f\u0435\u0440\u0430\u0442\u043e\u0440\u043e\u0432<\/a>\u00bb. \u0418\u043c\u043f\u0435\u0440\u0430\u0442\u043e\u0440\u044b \u0413\u0435\u0440\u043c\u0430\u043d\u0438\u0438, \u0410\u0432\u0441\u0442\u0440\u0438\u0438 \u0438 \u0420\u043e\u0441\u0441\u0438\u0438 \u043f\u043e\u0434\u043f\u0438\u0441\u0430\u043b\u0438 \u0442\u0430\u0439\u043d\u043e\u0435 \u0441\u043e\u0433\u043b\u0430\u0448\u0435\u043d\u0438\u0435, \u043f\u043e \u043a\u043e\u0442\u043e\u0440\u043e\u043c\u0443 \u0447\u043b\u0435\u043d\u044b \u0441\u043e\u044e\u0437\u0430 \u043e\u0431\u044f\u0437\u044b\u0432\u0430\u043b\u0438\u0441\u044c \u043d\u0435 \u043e\u043a\u0430\u0437\u044b\u0432\u0430\u0442\u044c \u043f\u043e\u0434\u0434\u0435\u0440\u0436\u043a\u0438 \u043d\u0438 \u043e\u0434\u043d\u043e\u043c\u0443 \u0433\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0443 \u043f\u0440\u0438 \u0435\u0433\u043e \u043d\u0430\u043f\u0430\u0434\u0435\u043d\u0438\u0438 \u043d\u0430 \u043e\u0434\u043d\u043e\u0433\u043e \u0438\u0437 \u0447\u043b\u0435\u043d\u043e\u0432 \u0441\u043e\u044e\u0437\u0430.<\/li><\/ul><h3>XX \u0432\u0435\u043a <\/h3><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1903_%D0%B3%D0%BE%D0%B4\" title=\"1903 \u0433\u043e\u0434\">1903<\/a>&#160;\u2014 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B0%D0%BD-%D0%A4%D1%80%D0%B0%D0%BD%D1%86%D0%B8%D1%81%D0%BA%D0%BE\" title=\"\u0421\u0430\u043d-\u0424\u0440\u0430\u043d\u0446\u0438\u0441\u043a\u043e\">\u0421\u0430\u043d-\u0424\u0440\u0430\u043d\u0446\u0438\u0441\u043a\u043e<\/a> \u0431\u044b\u043b \u0434\u0430\u043d \u0441\u0442\u0430\u0440\u0442 \u043f\u0435\u0440\u0432\u043e\u043c\u0443 \u0430\u0432\u0442\u043e\u043f\u0440\u043e\u0431\u0435\u0433\u0443 \u0447\u0435\u0440\u0435\u0437 \u043a\u043e\u043d\u0442\u0438\u043d\u0435\u043d\u0442. \u0415\u0433\u043e \u0443\u0447\u0430\u0441\u0442\u043d\u0438\u043a\u0438 \u0441\u043f\u0443\u0441\u0442\u044f \u0442\u0440\u0438 \u043c\u0435\u0441\u044f\u0446\u0430 \u0444\u0438\u043d\u0438\u0448\u0438\u0440\u043e\u0432\u0430\u043b\u0438 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D1%8C%D1%8E-%D0%99%D0%BE%D1%80%D0%BA\" title=\"\u041d\u044c\u044e-\u0419\u043e\u0440\u043a\">\u041d\u044c\u044e-\u0419\u043e\u0440\u043a\u0435<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1906_%D0%B3%D0%BE%D0%B4\" title=\"1906 \u0433\u043e\u0434\">1906<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B0%D1%80%D0%BA%D0%BE%D0%B2%D1%81%D0%BA%D0%B0%D1%8F_%D1%80%D0%B5%D1%81%D0%BF%D1%83%D0%B1%D0%BB%D0%B8%D0%BA%D0%B0\" title=\"\u041c\u0430\u0440\u043a\u043e\u0432\u0441\u043a\u0430\u044f \u0440\u0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a\u0430\">\u041c\u0430\u0440\u043a\u043e\u0432\u0441\u043a\u0430\u044f \u0440\u0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a\u0430<\/a> \u043f\u0440\u0435\u043a\u0440\u0430\u0442\u0438\u043b\u0430 \u0441\u0432\u043e\u0451 \u0441\u0443\u0449\u0435\u0441\u0442\u0432\u043e\u0432\u0430\u043d\u0438\u0435.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1907_%D0%B3%D0%BE%D0%B4\" title=\"1907 \u0433\u043e\u0434\">1907<\/a>&#160;\u2014 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%BE%D0%BD%D0%B4%D0%BE%D0%BD\" title=\"\u041b\u043e\u043d\u0434\u043e\u043d\">\u041b\u043e\u043d\u0434\u043e\u043d\u0435<\/a> \u0432\u0441\u0442\u0440\u0435\u0442\u0438\u043b\u0438\u0441\u044c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A8%D0%BE%D1%83,_%D0%94%D0%B6%D0%BE%D1%80%D0%B4%D0%B6_%D0%91%D0%B5%D1%80%D0%BD%D0%B0%D1%80%D0%B4\" title=\"\u0428\u043e\u0443, \u0414\u0436\u043e\u0440\u0434\u0436 \u0411\u0435\u0440\u043d\u0430\u0440\u0434\">\u0414\u0436\u043e\u0440\u0434\u0436 \u0411\u0435\u0440\u043d\u0430\u0440\u0434 \u0428\u043e\u0443<\/a> \u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B0%D1%80%D0%BA_%D0%A2%D0%B2%D0%B5%D0%BD\" title=\"\u041c\u0430\u0440\u043a \u0422\u0432\u0435\u043d\">\u041c\u0430\u0440\u043a \u0422\u0432\u0435\u043d<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1918_%D0%B3%D0%BE%D0%B4\" title=\"1918 \u0433\u043e\u0434\">1918<\/a>&#160;\u2014 \u0432 \u041d\u043e\u0432\u043e\u0440\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u043e\u0439 \u0431\u0443\u0445\u0442\u0435 \u043f\u043e\u0434 \u0440\u0443\u043a\u043e\u0432\u043e\u0434\u0441\u0442\u0432\u043e\u043c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%B0%D1%81%D0%BA%D0%BE%D0%BB%D1%8C%D0%BD%D0%B8%D0%BA%D0%BE%D0%B2,_%D0%A4%D1%91%D0%B4%D0%BE%D1%80_%D0%A4%D1%91%D0%B4%D0%BE%D1%80%D0%BE%D0%B2%D0%B8%D1%87\" title=\"\u0420\u0430\u0441\u043a\u043e\u043b\u044c\u043d\u0438\u043a\u043e\u0432, \u0424\u0451\u0434\u043e\u0440 \u0424\u0451\u0434\u043e\u0440\u043e\u0432\u0438\u0447\">\u0424\u0451\u0434\u043e\u0440\u0430 \u0420\u0430\u0441\u043a\u043e\u043b\u044c\u043d\u0438\u043a\u043e\u0432\u0430<\/a> \u0437\u0430\u0442\u043e\u043f\u043b\u0435\u043d <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A7%D0%B5%D1%80%D0%BD%D0%BE%D0%BC%D0%BE%D1%80%D1%81%D0%BA%D0%B8%D0%B9_%D1%84%D0%BB%D0%BE%D1%82_%D0%A0%D0%BE%D1%81%D1%81%D0%B8%D0%B9%D1%81%D0%BA%D0%BE%D0%B9_%D0%B8%D0%BC%D0%BF%D0%B5%D1%80%D0%B8%D0%B8\" class=\"mw-redirect\" title=\"\u0427\u0435\u0440\u043d\u043e\u043c\u043e\u0440\u0441\u043a\u0438\u0439 \u0444\u043b\u043e\u0442 \u0420\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u043e\u0439 \u0438\u043c\u043f\u0435\u0440\u0438\u0438\">\u0427\u0435\u0440\u043d\u043e\u043c\u043e\u0440\u0441\u043a\u0438\u0439 \u0444\u043b\u043e\u0442<\/a>, \u0447\u0442\u043e\u0431\u044b \u043d\u0435 \u043e\u0442\u0434\u0430\u0432\u0430\u0442\u044c \u0435\u0433\u043e \u043f\u043e \u0443\u0441\u043b\u043e\u0432\u0438\u044f\u043c \u0411\u0440\u0435\u0441\u0442\u0441\u043a\u043e\u0433\u043e \u043c\u0438\u0440\u0430.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1932_%D0%B3%D0%BE%D0%B4\" title=\"1932 \u0433\u043e\u0434\">1932<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%BE%D1%86%D0%B8%D0%B0%D0%BB%D0%B8%D1%81%D1%82%D0%B8%D1%87%D0%B5%D1%81%D0%BA%D0%B0%D1%8F_%D1%80%D0%B5%D1%81%D0%BF%D1%83%D0%B1%D0%BB%D0%B8%D0%BA%D0%B0_%D0%A7%D0%B8%D0%BB%D0%B8\" title=\"\u0421\u043e\u0446\u0438\u0430\u043b\u0438\u0441\u0442\u0438\u0447\u0435\u0441\u043a\u0430\u044f \u0440\u0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a\u0430 \u0427\u0438\u043b\u0438\">\u0421\u043e\u0446\u0438\u0430\u043b\u0438\u0441\u0442\u0438\u0447\u0435\u0441\u043a\u0430\u044f \u0440\u0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a\u0430 \u0427\u0438\u043b\u0438<\/a> \u043f\u0440\u0435\u043a\u0440\u0430\u0442\u0438\u043b\u0430 \u0441\u0432\u043e\u0451 \u0441\u0443\u0449\u0435\u0441\u0442\u0432\u043e\u0432\u0430\u043d\u0438\u0435.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1934_%D0%B3%D0%BE%D0%B4\" title=\"1934 \u0433\u043e\u0434\">1934<\/a>&#160;\u2014 \u0432 \u0410\u043d\u0433\u043b\u0438\u0438 \u043f\u0440\u0430\u0432\u0438\u0442\u0435\u043b\u044c\u0441\u0442\u0432\u043e \u043f\u0440\u0438\u0437\u0432\u0430\u043b\u043e \u0433\u0440\u0430\u0436\u0434\u0430\u043d \u043f\u043e\u043b\u044c\u0437\u043e\u0432\u0430\u0442\u044c\u0441\u044f \u043f\u0435\u0448\u0435\u0445\u043e\u0434\u043d\u044b\u043c\u0438 \u043f\u0435\u0440\u0435\u0445\u043e\u0434\u0430\u043c\u0438 \u043f\u0440\u0438 \u043f\u0435\u0440\u0435\u0441\u0435\u0447\u0435\u043d\u0438\u0438 \u0434\u043e\u0440\u043e\u0433\u0438.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1937_%D0%B3%D0%BE%D0%B4\" title=\"1937 \u0433\u043e\u0434\">1937<\/a>&#160;\u2014 \u044d\u043a\u0438\u043f\u0430\u0436 \u0441\u0430\u043c\u043e\u043b\u0451\u0442\u0430 \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%9D%D0%A2-25\" title=\"\u0410\u041d\u0422-25\">\u0410\u041d\u0422-25<\/a>\u00bb (<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A7%D0%BA%D0%B0%D0%BB%D0%BE%D0%B2,_%D0%92%D0%B0%D0%BB%D0%B5%D1%80%D0%B8%D0%B9_%D0%9F%D0%B0%D0%B2%D0%BB%D0%BE%D0%B2%D0%B8%D1%87\" title=\"\u0427\u043a\u0430\u043b\u043e\u0432, \u0412\u0430\u043b\u0435\u0440\u0438\u0439 \u041f\u0430\u0432\u043b\u043e\u0432\u0438\u0447\">\u0412\u0430\u043b\u0435\u0440\u0438\u0439 \u0427\u043a\u0430\u043b\u043e\u0432<\/a>, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B0%D0%B9%D0%B4%D1%83%D0%BA%D0%BE%D0%B2,_%D0%93%D0%B5%D0%BE%D1%80%D0%B3%D0%B8%D0%B9_%D0%A4%D0%B8%D0%BB%D0%B8%D0%BF%D0%BF%D0%BE%D0%B2%D0%B8%D1%87\" title=\"\u0411\u0430\u0439\u0434\u0443\u043a\u043e\u0432, \u0413\u0435\u043e\u0440\u0433\u0438\u0439 \u0424\u0438\u043b\u0438\u043f\u043f\u043e\u0432\u0438\u0447\">\u0413\u0435\u043e\u0440\u0433\u0438\u0439 \u0411\u0430\u0439\u0434\u0443\u043a\u043e\u0432<\/a>, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B5%D0%BB%D1%8F%D0%BA%D0%BE%D0%B2,_%D0%90%D0%BB%D0%B5%D0%BA%D1%81%D0%B0%D0%BD%D0%B4%D1%80_%D0%92%D0%B0%D1%81%D0%B8%D0%BB%D1%8C%D0%B5%D0%B2%D0%B8%D1%87_(%D0%BB%D1%91%D1%82%D1%87%D0%B8%D0%BA)\" title=\"\u0411\u0435\u043b\u044f\u043a\u043e\u0432, \u0410\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440 \u0412\u0430\u0441\u0438\u043b\u044c\u0435\u0432\u0438\u0447 (\u043b\u0451\u0442\u0447\u0438\u043a)\">\u0410\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440 \u0411\u0435\u043b\u044f\u043a\u043e\u0432<\/a>) \u043d\u0430\u0447\u0430\u043b \u0431\u0435\u0441\u043f\u043e\u0441\u0430\u0434\u043e\u0447\u043d\u044b\u0439 \u043f\u0435\u0440\u0435\u043b\u0451\u0442 \u043f\u043e \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0443 \u041c\u043e\u0441\u043a\u0432\u0430&#160;\u2014 \u0421\u0435\u0432\u0435\u0440\u043d\u044b\u0439 \u043f\u043e\u043b\u044e\u0441&#160;\u2014 \u0421\u0428\u0410, \u0443\u0441\u043f\u0435\u0448\u043d\u043e \u0437\u0430\u0432\u0435\u0440\u0448\u0438\u0432 \u0435\u0433\u043e 20 \u0438\u044e\u043d\u044f \u043f\u0440\u0438\u0437\u0435\u043c\u043b\u0435\u043d\u0438\u0435\u043c \u043d\u0430 \u0430\u044d\u0440\u043e\u0434\u0440\u043e\u043c\u0435 \u0433\u043e\u0440\u043e\u0434\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B0%D0%BD%D0%BA%D1%83%D0%B2%D0%B5%D1%80\" title=\"\u0412\u0430\u043d\u043a\u0443\u0432\u0435\u0440\">\u0412\u0430\u043d\u043a\u0443\u0432\u0435\u0440<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1939_%D0%B3%D0%BE%D0%B4\" title=\"1939 \u0433\u043e\u0434\">1939<\/a><ul><li>\u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D0%BD%D0%B5%D0%B2\" title=\"\u041a\u0430\u043d\u0435\u0432\">\u041a\u0430\u043d\u0435\u0432\u0435<\/a> \u043d\u0430 \u043c\u043e\u0433\u0438\u043b\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A8%D0%B5%D0%B2%D1%87%D0%B5%D0%BD%D0%BA%D0%BE,_%D0%A2%D0%B0%D1%80%D0%B0%D1%81_%D0%93%D1%80%D0%B8%D0%B3%D0%BE%D1%80%D1%8C%D0%B5%D0%B2%D0%B8%D1%87\" title=\"\u0428\u0435\u0432\u0447\u0435\u043d\u043a\u043e, \u0422\u0430\u0440\u0430\u0441 \u0413\u0440\u0438\u0433\u043e\u0440\u044c\u0435\u0432\u0438\u0447\">\u0422\u0430\u0440\u0430\u0441\u0430 \u0428\u0435\u0432\u0447\u0435\u043d\u043a\u043e<\/a> \u043e\u0442\u043a\u0440\u044b\u0442 \u043f\u0430\u043c\u044f\u0442\u043d\u0438\u043a.<\/li><li>\u0412 \u0421\u0421\u0421\u0420 \u0438\u0437 \u044d\u043c\u0438\u0433\u0440\u0430\u0446\u0438\u0438 \u0432\u0435\u0440\u043d\u0443\u043b\u0430\u0441\u044c \u043f\u043e\u044d\u0442\u0435\u0441\u0441\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A6%D0%B2%D0%B5%D1%82%D0%B0%D0%B5%D0%B2%D0%B0,_%D0%9C%D0%B0%D1%80%D0%B8%D0%BD%D0%B0_%D0%98%D0%B2%D0%B0%D0%BD%D0%BE%D0%B2%D0%BD%D0%B0\" title=\"\u0426\u0432\u0435\u0442\u0430\u0435\u0432\u0430, \u041c\u0430\u0440\u0438\u043d\u0430 \u0418\u0432\u0430\u043d\u043e\u0432\u043d\u0430\">\u041c\u0430\u0440\u0438\u043d\u0430 \u0426\u0432\u0435\u0442\u0430\u0435\u0432\u0430<\/a>.<\/li><\/ul><\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1940_%D0%B3%D0%BE%D0%B4\" title=\"1940 \u0433\u043e\u0434\">1940<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%B5%D1%87%D1%8C_18_%D0%B8%D1%8E%D0%BD%D1%8F\" title=\"\u0420\u0435\u0447\u044c 18 \u0438\u044e\u043d\u044f\">\u0412\u043e\u0437\u0437\u0432\u0430\u043d\u0438\u0435<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%94%D0%B5_%D0%93%D0%BE%D0%BB%D0%BB%D1%8C,_%D0%A8%D0%B0%D1%80%D0%BB%D1%8C\" title=\"\u0414\u0435 \u0413\u043e\u043b\u043b\u044c, \u0428\u0430\u0440\u043b\u044c\">\u0413\u0435\u043d\u0435\u0440\u0430\u043b\u0430 \u0434\u0435 \u0413\u043e\u043b\u043b\u044f<\/a> \u0438\u0437 \u041b\u043e\u043d\u0434\u043e\u043d\u0430 (\u043d\u0430 \u0432\u043e\u043b\u043d\u0430\u0445 BBC) \u043a <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%94%D0%B2%D0%B8%D0%B6%D0%B5%D0%BD%D0%B8%D0%B5_%D0%A1%D0%BE%D0%BF%D1%80%D0%BE%D1%82%D0%B8%D0%B2%D0%BB%D0%B5%D0%BD%D0%B8%D1%8F_(%D0%A4%D1%80%D0%B0%D0%BD%D1%86%D0%B8%D1%8F)\" title=\"\u0414\u0432\u0438\u0436\u0435\u043d\u0438\u0435 \u0421\u043e\u043f\u0440\u043e\u0442\u0438\u0432\u043b\u0435\u043d\u0438\u044f (\u0424\u0440\u0430\u043d\u0446\u0438\u044f)\">\u0421\u043e\u043f\u0440\u043e\u0442\u0438\u0432\u043b\u0435\u043d\u0438\u044e<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1945_%D0%B3%D0%BE%D0%B4\" title=\"1945 \u0433\u043e\u0434\">1945<\/a><ul><li>\u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B0%D0%BD%D0%BA%D1%82-%D0%9F%D0%B5%D1%82%D0%B5%D1%80%D0%B1%D1%83%D1%80%D0%B3\" title=\"\u0421\u0430\u043d\u043a\u0442-\u041f\u0435\u0442\u0435\u0440\u0431\u0443\u0440\u0433\">\u041b\u0435\u043d\u0438\u043d\u0433\u0440\u0430\u0434\u0435<\/a> \u0432\u044b\u0448\u0435\u043b \u043d\u0430 \u043c\u0430\u0440\u0448\u0440\u0443\u0442 \u043f\u0435\u0440\u0432\u044b\u0439 \u043f\u043e\u0441\u043b\u0435 \u0431\u043b\u043e\u043a\u0430\u0434\u044b \u0442\u0440\u043e\u043b\u043b\u0435\u0439\u0431\u0443\u0441.<\/li><li>\u0424\u0440\u0430\u043d\u0446\u0443\u0437\u0441\u043a\u0438\u0439 \u0430\u0432\u0438\u0430\u043f\u043e\u043b\u043a \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%BE%D1%80%D0%BC%D0%B0%D0%BD%D0%B4%D0%B8%D1%8F-%D0%9D%D0%B5%D0%BC%D0%B0%D0%BD\" class=\"mw-redirect\" title=\"\u041d\u043e\u0440\u043c\u0430\u043d\u0434\u0438\u044f-\u041d\u0435\u043c\u0430\u043d\">\u041d\u043e\u0440\u043c\u0430\u043d\u0434\u0438\u044f-\u041d\u0435\u043c\u0430\u043d<\/a>\u00bb \u0432\u044b\u043b\u0435\u0442\u0435\u043b \u0438\u0437 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%A1%D0%A1%D0%A0\" class=\"mw-redirect\" title=\"\u0421\u0421\u0421\u0420\">\u0421\u0421\u0421\u0420<\/a> \u0432\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A4%D1%80%D0%B0%D0%BD%D1%86%D0%B8%D1%8F\" title=\"\u0424\u0440\u0430\u04