org\/wiki\/%D0%9E%D0%B4%D0%B8%D0%BD_%D0%BD%D0%B0_%D0%BE%D0%B4%D0%B8%D0%BD_(%D1%82%D0%B5%D0%BB%D0%B5%D0%BF%D0%B5%D1%80%D0%B5%D0%B4%D0%B0%D1%87%D0%B0)\" title=\"\u041e\u0434\u0438\u043d \u043d\u0430 \u043e\u0434\u0438\u043d (\u0442\u0435\u043b\u0435\u043f\u0435\u0440\u0435\u0434\u0430\u0447\u0430)\">\u041e\u0434\u0438\u043d \u043d\u0430 \u043e\u0434\u0438\u043d<\/a>\u00bb \u0441 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D1%8E%D0%B1%D0%B8%D0%BC%D0%BE%D0%B2,_%D0%90%D0%BB%D0%B5%D0%BA%D1%81%D0%B0%D0%BD%D0%B4%D1%80_%D0%9C%D0%B8%D1%85%D0%B0%D0%B9%D0%BB%D0%BE%D0%B2%D0%B8%D1%87_(%D0%B6%D1%83%D1%80%D0%BD%D0%B0%D0%BB%D0%B8%D1%81%D1%82)\" title=\"\u041b\u044e\u0431\u0438\u043c\u043e\u0432, \u0410\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440 \u041c\u0438\u0445\u0430\u0439\u043b\u043e\u0432\u0438\u0447 (\u0436\u0443\u0440\u043d\u0430\u043b\u0438\u0441\u0442)\">\u0410\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440\u043e\u043c \u041b\u044e\u0431\u0438\u043c\u043e\u0432\u044b\u043c<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%96%D0%B8%D1%80%D0%B8%D0%BD%D0%BE%D0%B2%D1%81%D0%BA%D0%B8%D0%B9,_%D0%92%D0%BB%D0%B0%D0%B4%D0%B8%D0%BC%D0%B8%D1%80_%D0%92%D0%BE%D0%BB%D1%8C%D1%84%D0%BE%D0%B2%D0%B8%D1%87\" title=\"\u0416\u0438\u0440\u0438\u043d\u043e\u0432\u0441\u043a\u0438\u0439, \u0412\u043b\u0430\u0434\u0438\u043c\u0438\u0440 \u0412\u043e\u043b\u044c\u0444\u043e\u0432\u0438\u0447\">\u0412\u043b\u0430\u0434\u0438\u043c\u0438\u0440 \u0416\u0438\u0440\u0438\u043d\u043e\u0432\u0441\u043a\u0438\u0439<\/a> \u0432\u043e \u0432\u0440\u0435\u043c\u044f \u0434\u0435\u0431\u0430\u0442\u043e\u0432 \u043e\u0431\u043b\u0438\u043b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%B5%D0%BC%D1%86%D0%BE%D0%B2,_%D0%91%D0%BE%D1%80%D0%B8%D1%81_%D0%95%D1%84%D0%B8%D0%BC%D0%BE%D0%B2%D0%B8%D1%87\" title=\"\u041d\u0435\u043c\u0446\u043e\u0432, \u0411\u043e\u0440\u0438\u0441 \u0415\u0444\u0438\u043c\u043e\u0432\u0438\u0447\">\u0411\u043e\u0440\u0438\u0441\u0430 \u041d\u0435\u043c\u0446\u043e\u043